 for the way you work.\",\n        \"_posts_grid_0_description\": \"field_611cf48422d86\",\n        \"posts_grid_0_button_text\": \"Learn more\",\n        \"_posts_grid_0_button_text\": \"field_611cf4b422d88\",\n        \"posts_grid_0_button_link\": \"#\",\n        \"_posts_grid_0_button_link\": \"field_611cf4d022d89\",\n        \"posts_grid_0_button_background\": \"#FF6B0B\",\n        \"_posts_grid_0_button_background\": \"field_611cf4dd22d8a\",\n        \"posts_grid_1_image\": 18,\n        \"_posts_grid_1_image\": \"field_611cf46e22d84\",\n        \"posts_grid_1_heading\": \"Truckload Freight Shipping\",\n        \"_posts_grid_1_heading\": \"field_611cf47e22d85\",\n        \"posts_grid_1_description\": \"Visibility, efficiency, lower costs and supply chain control. Ship smoother with less disruptions and customized solutions for the way you work.\",\n        \"_posts_grid_1_description\": \"field_611cf48422d86\",\n        \"posts_grid_1_button_text\": \"Learn more\",\n        \"_posts_grid_1_button_text\": \"field_611cf4b422d88\",\n        \"posts_grid_1_button_link\": \"#\",\n        \"_posts_grid_1_button_link\": \"field_611cf4d022d89\",\n        \"posts_grid_1_button_background\": \"#FF6B0B\",\n        \"_posts_grid_1_button_background\": \"field_611cf4dd22d8a\",\n        \"posts_grid_2_image\": 18,\n        \"_posts_grid_2_image\": \"field_611cf46e22d84\",\n        \"posts_grid_2_heading\": \"Truckload Freight Shipping\",\n        \"_posts_grid_2_heading\": \"field_611cf47e22d85\",\n        \"posts_grid_2_description\": \"Visibility, efficiency, lower costs and supply chain control. Ship smoother with less disruptions and customized solutions for the way you work.\",\n        \"_posts_grid_2_description\": \"field_611cf48422d86\",\n        \"posts_grid_2_button_text\": \"Learn more\",\n        \"_posts_grid_2_button_text\": \"field_611cf4b422d88\",\n        \"posts_grid_2_button_link\": \"#\",\n        \"_posts_grid_2_button_link\": \"field_611cf4d022d89\",\n        \"posts_grid_2_button_background\": \"#FF6B0B\",\n        \"_posts_grid_2_button_background\": \"field_611cf4dd22d8a\",\n        \"posts_grid\": 3,\n        \"_posts_grid\": \"field_611ccd529333c\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:acf/getstarted {\n    \"id\": \"block_61165822a3d03\",\n    \"name\": \"acf\\/getstarted\",\n    \"data\": {\n        \"heading\": \"Let’s Get Started!\",\n        \"_heading\": \"field_611ccf0f04c0a\",\n        \"text\": \"Compare shipping rates in an instant.\",\n        \"_text\": \"field_611ccf1b04c0b\",\n        \"button_text\": \"Get Quote\",\n        \"_button_text\": \"field_611ccf1f04c0c\",\n        \"button_link\": \"#\",\n        \"_button_link\": \"field_611ccf2a04c0d\",\n        \"button_background\": \"#FF6B0B\",\n        \"_button_background\": \"field_611ccf3204c0e\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:acf/shipping-header {\n    \"id\": \"block_61166789eddd8\",\n    \"name\": \"acf\\/shipping-header\",\n    \"data\": {\n        \"heading\": \"Residential Shipping.\",\n        \"_heading\": \"field_611cd03bd0bd0\",\n        \"description\": \"Your one stop shipping shop.\",\n        \"_description\": \"field_611cd047d0bd1\",\n        \"image\": 21,\n        \"_image\": \"field_611cd04cd0bd2\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:acf/get-quote {\n    \"id\": \"block_6116714770039\",\n    \"name\": \"acf\\/get-quote\",\n    \"data\": {\n        \"heading\": \"Get Your Free Shipping Quote\",\n        \"_heading\": \"field_611cd0b0e0ceb\",\n        \"form_shortcode\": \"\",\n        \"_form_shortcode\": \"field_611cd0cce0cec\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:acf/shipping-easy {\n    \"id\": \"block_611678e08acef\",\n    \"name\": \"acf\\/shipping-easy\",\n    \"data\": {\n        \"heading\": \"We’re Making <b>Shipping Easy.<\\/b>\",\n        \"_heading\": \"field_611cd0ee15659\",\n        \"description\": \"Remove the guesswork and get a simplified shipping process with affordable rates and expert assistance every step of the way. Quickly compare carriers for the easiest way to ship anything, anywhere and kiss the “I have no idea what I’m doing” frustrations goodbye!\",\n        \"_description\": \"field_611cd1031565a\",\n        \"button_text\": \"Learn More\",\n        \"_button_text\": \"field_611cd11a1565b\",\n        \"button_link\": \"#\",\n        \"_button_link\": \"field_611cd1231565c\",\n        \"button_collor\": \"#489BE8\",\n        \"_button_collor\": \"field_611cd12e1565d\",\n        \"icon_blocks_0_icon\": 25,\n        \"_icon_blocks_0_icon\": \"field_611cd15d1565f\",\n        \"icon_blocks_0_heading\": \"Expert Assistance\",\n        \"_icon_blocks_0_heading\": \"field_611cd16d15660\",\n        \"icon_blocks_0_description\": \"Quickly and easily find the best options and affordable rates from all major shipping companies in one convenient online location.\",\n        \"_icon_blocks_0_description\": \"field_611cd17315661\",\n        \"icon_blocks_1_icon\": 25,\n        \"_icon_blocks_1_icon\": \"field_611cd15d1565f\",\n        \"icon_blocks_1_heading\": \"Expert Assistance\",\n        \"_icon_blocks_1_heading\": \"field_611cd16d15660\",\n        \"icon_blocks_1_description\": \"Quickly and easily find the best options and affordable rates from all major shipping companies in one convenient online location.\",\n        \"_icon_blocks_1_description\": \"field_611cd17315661\",\n        \"icon_blocks_2_icon\": 25,\n        \"_icon_blocks_2_icon\": \"field_611cd15d1565f\",\n        \"icon_blocks_2_heading\": \"Expert Assistance\",\n        \"_icon_blocks_2_heading\": \"field_611cd16d15660\",\n        \"icon_blocks_2_description\": \"Quickly and easily find the best options and affordable rates from all major shipping companies in one convenient online location.\",\n        \"_icon_blocks_2_description\": \"field_611cd17315661\",\n        \"icon_blocks_3_icon\": 25,\n        \"_icon_blocks_3_icon\": \"field_611cd15d1565f\",\n        \"icon_blocks_3_heading\": \"Expert Assistance\",\n        \"_icon_blocks_3_heading\": \"field_611cd16d15660\",\n        \"icon_blocks_3_description\": \"Quickly and easily find the best options and affordable rates from all major shipping companies in one convenient online location.\",\n        \"_icon_blocks_3_description\": \"field_611cd17315661\",\n        \"icon_blocks\": 4,\n        \"_icon_blocks\": \"field_611cd14e1565e\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:acf/first-time {\n    \"id\": \"block_611a0db5f6944\",\n    \"name\": \"acf\\/first-time\",\n    \"data\": {\n        \"blocks_0_heading\": \"First-time Shipper?\",\n        \"_blocks_0_heading\": \"field_611cd1c135588\",\n        \"blocks_0_content\": \"Whether you’re shipping a refrigerator to your new home, furniture to a relative or a television you just bought online, FreightCenter can save you time and money and help ship your items easily and safely. But first things first – what are you shipping? Is it freight or parcel? And how can you tell?\",\n        \"_blocks_0_content\": \"field_611cd1cb35589\",\n        \"blocks_0_background_color\": \"#343A40\",\n        \"_blocks_0_background_color\": \"field_611d04d5a4b6b\",\n        \"blocks_0_color\": \"#ffffff\",\n        \"_blocks_0_color\": \"field_611d04f2a4b6c\",\n        \"blocks_1_heading\": \"Freight vs Parcel…\",\n        \"_blocks_1_heading\": \"field_611cd1c135588\",\n        \"blocks_1_content\": \"<ul>\\r\\n \\t<li>Over 150 pounds is freight, under is parcel.<\\/li>\\r\\n \\t<li>More than 108 inches in length is freight, under is parcel.<\\/li>\\r\\n \\t<li>More than 165 inches in both length and girth combined is freight, below is parcel.<\\/li>\\r\\n \\t<li>Standard services from USPS, UPS and FedEx are used for parcel, not freight. This is where we come in – we can help with both parcel &amp; freight shipping.<\\/li>\\r\\n<\\/ul>\",\n        \"_blocks_1_content\": \"field_611cd1cb35589\",\n        \"blocks_1_background_color\": \"#489be8\",\n        \"_blocks_1_background_color\": \"field_611d04d5a4b6b\",\n        \"blocks_1_color\": \"#ffffff\",\n        \"_blocks_1_color\": \"field_611d04f2a4b6c\",\n        \"blocks\": 2,\n        \"_blocks\": \"field_611cd1ab35587\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:acf/services {\n    \"id\": \"block_611a6e10d05ca\",\n    \"name\": \"acf\\/services\",\n    \"data\": {\n        \"heading\": \"Our Truckload Services.\",\n        \"_heading\": \"field_611cd1f5923cd\",\n        \"description\": \"FreightCenter’s extensive network of carriers provide access to a wide range of truckload equipment types including flatbeds, enclosed trailers, refrigerated trailers, rail freight, double drop trailers, removable gooseneck (RGN) trailers, step decks, as well as stretch trailers that can haul oversized truck freight.\",\n        \"_description\": \"field_611cd1fa923ce\",\n        \"items_per_row\": \"3\",\n        \"_items_per_row\": \"field_611e0d58b873f\",\n        \"icons_block_0_heading\": \"Flatbed.\",\n        \"_icons_block_0_heading\": \"field_611cd22e923d0\",\n        \"icons_block_0_description\": \"Managing your freight shipping process is a time buster and finding affordable, trustworthy carriers takes time. We vet all our carriers with strict compliance, so you can instantly compare freight rates from hundreds of carriers and book shipments in nothing flat!\",\n        \"_icons_block_0_description\": \"field_611cd233923d1\",\n        \"icons_block_0_icon\": 32,\n        \"_icons_block_0_icon\": \"field_611cd23b923d2\",\n        \"icons_block_1_heading\": \"Dry Van.\",\n        \"_icons_block_1_heading\": \"field_611cd22e923d0\",\n        \"icons_block_1_description\": \"Leverage our large network of vetted carriers to secure discounted rates for all your shipping needs. Discover and compare the best options, routes and carriers and get your cargo delivered safely for a great price.\",\n        \"_icons_block_1_description\": \"field_611cd233923d1\",\n        \"icons_block_1_icon\": 32,\n        \"_icons_block_1_icon\": \"field_611cd23b923d2\",\n        \"icons_block_2_heading\": \"Refrigerated.\",\n        \"_icons_block_2_heading\": \"field_611cd22e923d0\",\n        \"icons_block_2_description\": \"Enjoy the convenience of one shipping platform for all your shipping needs. Our easy-to-use online portal centralizes your shipping in one location, so you have more time to grow your business and manage the more important things.\",\n        \"_icons_block_2_description\": \"field_611cd233923d1\",\n        \"icons_block_2_icon\": 32,\n        \"_icons_block_2_icon\": \"field_611cd23b923d2\",\n        \"icons_block_3_heading\": \"Step Deck.\",\n        \"_icons_block_3_heading\": \"field_611cd22e923d0\",\n        \"icons_block_3_description\": \"Our aim is to make your job easier – think of us as your own shipping department. No matter the complexity of your shipment or the unknowns, we remove the hassles and streamline the process making your shipping a breeze.\",\n        \"_icons_block_3_description\": \"field_611cd233923d1\",\n        \"icons_block_3_icon\": 32,\n        \"_icons_block_3_icon\": \"field_611cd23b923d2\",\n        \"icons_block_4_heading\": \"Removable Gooseneck.\",\n        \"_icons_block_4_heading\": \"field_611cd22e923d0\",\n        \"icons_block_4_description\": \"With decades of freight shipping and logistics experience, we help you navigate today and plan for tomorrow. While you focus on your business, we’ll make sure your goods get where they’re going the most efficient way.\",\n        \"_icons_block_4_description\": \"field_611cd233923d1\",\n        \"icons_block_4_icon\": 32,\n        \"_icons_block_4_icon\": \"field_611cd23b923d2\",\n        \"icons_block\": 5,\n        \"_icons_block\": \"field_611cd20f923cf\"\n    },\n    \"mode\": \"auto\"\n} /-->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Front Page', '', 'publish', 'closed', 'closed', '', 'front-page', '', '', '2021-08-25 07:34:06', '2021-08-25 07:34:06', '', 0, 'http://localhost/?page_id=8', 0, 'page', '', 0),
